issue.body:
**Is your feature request related to a problem? Please describe.**
In order to find segfault, and also for debugging shapes are important but printing values will make 
`onnxruntime_DEBUG_NODE_INPUTS_OUTPUTS` not very useful.


**System information**
- ONNX Runtime version (you are using): master

**Describe the solution you'd like**
Provide `onnxruntime_DEBUG_NODE_INPUTS_OUTPUTS_SHAPES` to only print shapes (avoid DumpTensor)

A clear and concise description of what you want to happen.

**Describe alternatives you've considered**
modify `DumpTensor` to return early
```c++
 static void DumpTensor(const Tensor& tensor, const TensorShape& shape) {
   auto num_items = shape.Size();
-
   if (num_items == 0) {
     std::cout << "no data";
     return;
   }
-
+  std::cout << "data";
+  return;
```

**Additional context**
`onnxruntime_DEBUG_NODE_INPUTS_OUTPUTS` build option suggested [here](https://github.com/microsoft/onnxruntime/issues/1691) is too verbose
